  return (
    <div className="movies-container">
      <div className="movies-navbar">
        <span className="movies-logo"></span>
        <span className="movies-search-bar"></span>
        <span className="movies-user-icon"></span>
      </div>
      <div className='movies-movies-list'>

      </div>
    </div>
  )
}
